import React, { useState } from 'react';
import './Shelf.css'
import Facing from './Facing';
import Card from '../UI/Card';
const Shelf = (props) => {

  console.log(props);
  // const [singleShelf, setSingleShelf] = useState([])
  // setSingleShelf(props)
  return (
    <div>
    <Card className='shelf'>
    {props.items &&props.items.map((items,index) => (

      <Facing
        key={index}
        shelfID={items.shelfID}
        facingID={items.facingID}
        productUPC={items.productUPC}
        displayFixtureID={items.displayFixtureID}
      />
    ))}

    </Card>

</div>
  );

};

export default Shelf;
